export default {
    name: 'IntroPage',
    data () {
        return {
            message: ''
        }
    },
    created() {
        const apiBaseUrl = process.env.VUE_APP_API_BASE_URL;
        fetch(`${apiBaseUrl}/main/api/intro/`)
        .then(response => response.json())
        .then(data => {
            this.message = data.message
        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });
    }
}
